    "text" : "\"Blockchain\" here seems to mean \"decentralized personal data\".\n\nWe looked at about 80 such projects and concluded that:\n1. It's far harder to pull off than it sounds\n2. Even if you can get adoption, it's unlikely that decentralization will improve privacy https:\/\/t.co\/z2JNDsaKfX https:\/\/t.co\/ZJs79PlsRA",
